import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <div className="HeaderContainer">
      <h1 className="header-title">OptimiseYourSearch.com</h1>
      <h2>Modify your Google Search by limiting sites and/or date</h2>
      <h4>By Josh W</h4>
    </div>
  );
};

export default Header;
